import React, { Component } from 'react'

export default class Combo extends Component {
    render() {
        return (
            <div>
                <div className="mt-5 combo-main-div container-fluid">
                    <div className="container" >
                        <div className="text-white  text-center combo-main-heading" >
                            <h1 >START UP COMBO</h1>
                        </div>
                        <p className="text-center">Suitable for potential super-startups and brand revamps for companies</p>

                    </div>

                </div>

            </div>
        )
    }
}
